import { makeStyles } from "@mui/styles";

export const useStyles = makeStyles({
  appBar:{
    borderRadius:'0 0 20px 20px'
  },
  bar:{
    display:'flex',
    justifyContent:'space-between',
    width:'100%'
  },
  menu:{
    color:white
  }
})
